import React from 'react';

const StyledBlockquote = ({ children }) => {
  return (
    <blockquote className="border-l-4 border-brand-emphasis p-4 my-8 bg-white shadow-md">
      <p className="text-xl italic leading-relaxed text-brand-dark">
        {children}
      </p>
    </blockquote>
  );
};

export default StyledBlockquote;
